import React from 'react';
import './App.css';
import Header from './components/Header';

function App() {
  return (
    <>
    <div className="App">
      <header className="App-header">
        <p>
          Demo App using React, NodeJS and Twitter API
        </p>
      </header>
    </div>,
    <Header/>
  </>
  );
}

export default App;
